public class ValidAnagram {
    public void swap (char[] c , int i , int j){
        char temp = c[i];
        c[i] = c[j];
        c[j] = temp;
    }
    //排序
    public void sortString(char[] c,int left , int right){
        if(left>=right) return;
        char k= c[(left+right)/2];
        int i = left;
        int j = right;
        while(i<j){
            while(c[j]>k&&i<j) j--;
            while(c[i]<=k&&i<j) i++;
           swap(c,i,j);
        }
        swap(c,i,(left+right)/2);
        sortString(c,left,i-1);
        sortString(c,i+1,right);
    }
    public boolean isAnagram(String s, String t) {
        char[] c = s.toCharArray();
        char[] g = t.toCharArray();
        Arrays.sort(c);
        Arrays.sort(g);
       return  s.equals(t);
    }
    public boolean isAnagram1(String s, String t) {
        char[] c = s.toCharArray();
        char[] g = t.toCharArray();
       sortString(c,0,s.length()-1);
       sortString(g,0,t.length()-1);
        System.out.println(new String(c));
        return  s.equals(t);
    }

    public static void main(String[] args) {
        String s =
                "";
        long begin1 = System.currentTimeMillis();
        new ValidAnagram().isAnagram(s,s);
        long end1 = System.currentTimeMillis();
        System.out.println("sort："+(end1-begin1)+"ms");
        System.out.println(s.length());

        long begin2 = System.currentTimeMillis();
        new ValidAnagram().isAnagram1(s,s);
        long end2 =System.currentTimeMillis();
        System.out.println("手写:"+(end2-begin2)+"ms");


    }
}
